import { BrowserRouter, Route} from "react-router-dom";


function App() {
  return (
    <BrowserRouter>
      <Route>
    <div className="App">

      <header className="App-header">

      </header>
    </div>
      </Route>
      </BrowserRouter>
  );
}

export default App;
